import logo from "../images/Logo-Mesto-Russia.svg"

function Header({ email, isLogin }) {
  return (
    <header className="header">
      <img src={logo} className="header__logo" alt="Логотип" />
      {isLogin && <div>
        <p>{email}</p>
        <button>Выйти</button>
      </div>}
      {!isLogin && <button></button>}
    </header>
  );
}

export default Header;
